import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{
  constructor(){
    super();

    this.state = {
      monsters:[
        {
          name: 'Frankestine'
        },{
          name: 'Dracula'
        },{
          name: 'Zombie'
        }
      ]
    };
  }

  render(){
    return (
      <div className="App">
        {
          this.state.monsters.map(monster => <h2>{monster.name}</h2>)
        }
      </div>
    ) 
  }
}

export default App;
